from typing import List


class Solution:
    def canCompleteCircuit(self, gas: List[int], cost: List[int]) -> int:

        margin = [0] * len(gas)

        total_diff = 0
        max_margin_index = 0
        for i in range(len(gas)):
            margin[i] = gas[i] - cost[i]
            total_diff += margin[i]

            if margin[i] > margin[max_margin_index]:
                max_margin_index = i

        # not possible
        if total_diff < 0:
            print("-1")
            return -1

        outer_index = 0
        size = len(margin)
        while outer_index < size:
            inner_index = outer_index
            tank = 0
            for i in range(size):
                tank += margin[(i + inner_index) % size]
                if tank < 0:
                    ##
                    # the optimizer
                    ##
                    outer_index = i + inner_index
                    break
            if tank >= 0:
                # so answer is outer index now
                break
            outer_index += 1
        print(outer_index)
        return outer_index

        # print(margin)
        # print(max_margin_index)
        # print(total_diff)

        # if total_diff < 0:
        #     return -1
        # else:
        #     return max_margin_index


